import React from 'react';
import ProcessFlow from './pages/ProcessFlow';
import { Routes, Route } from "react-router-dom";
import { Home } from './pages/Home';

const App: React.FC = () => {
  return (
    <main>
      <Routes>
        <Route path="/"  element={<Home />}/>
        <Route path='/mapeamentos' Component={ProcessFlow}/>
      </Routes>
    </main>
  );
};

export default App;
